package com.javaex.practice.copy;

public class Ex08 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i, x;
		for (i = 2; i <=9; i++) {
			for (x = 1; x <=9; x++) {
				System.out.print(i+"*"+x+"="+(x*i)+"\t");
			}
			System.out.println("");
		}
	}
}
